# Parameter sets of systems to be used for each phase. Notice that for later phases additional
#   parameters are added, so the tuples are not always the same length across phases. The order
#   of parameters is the same as taken by the constructor of Task0013Simulation.
# The line width is obviously too long, but at least allows differences to be spotted easily.
#
# A description of the parameters (even if trivial):
#   polymer - gaussian chain architecture of the block copolymer
#   volume  - bead volume of the gaussian chai polymer
#   exp     - expansion coefficient (dictates noise in the field)
#   dens    - reference density of the polymer field
#   kappa   - compressibility coefficient (damping of field fluctuations)
#   nchi    - interaction parameter between A and B block copolymer components
#   ca      - coupling constant between NP beads and the polymer A block
#   cb      - coupling constant between NP beads and the polymer B block
#   mob     - mobility factor or diffusion constant for the nanoparticles
#   temp    - dimensionless temperature (affects only particles)
#   size    - box size used for simulation
#   popul   - number of nanoparticles in the simulation box
#   tstep   - time step used throughout the simulations
#   ttime   - total time of the simulation
#   chmob   - (from phase 10) mobility factor or diffusion constant for the polymer chains
#   cc      - (from phase 13) coupling constant between NP core boeads and all polymer blocks
#   np      - (from phase 14) name of the nanoparticle model
#   sigma   - (from phase 15) spread parameter used in the nanoparticle model
#   disp    - (from phase 18) dispersion factor for initial NP distribution
#

